    public function getSourceContext()
    {
        return new Source("{# Małgorzata Wieteska #}
{% extends 'base.html.twig' %}

{% block title %}BikeLando - Rejestracja{% endblock %}
{% block body %}
    <!-- rejestracja -->
    {% for flashMessage in app.session.flashbag.get('check') %}
        <div class=\"alert alert-danger\">
            {{ flashMessage }}
        </div>
    {% endfor %}
<div class=\"row\" id=\"zakladki\">
    <div class=\"col\">
        <div class=\"card bg-transparent border-dark\">
            <div class=\"card-body\">
    {% for flashError in app.flashes('verify_email_error') %}
        <div class=\"alert alert-danger\" role=\"alert\">{{ flashError }}</div>
    {% endfor %}

    <h1>Dołącz do nas!</h1>

        {{ form_start(registrationForm) }}
        {{ form_row(registrationForm.email) }}
        {{ form_row(registrationForm.username,
                {label: 'Nazwa użytkownika'
                })}}
        {{ form_row(registrationForm.plainPassword, {
            label: 'Hasło'
        }) }}
        {{ form_row(registrationForm.agreeTerms) }}
        <button type=\"submit\" class=\"btn btn-outline-success\">Zarejestruj</button>

        {{ form_end(registrationForm) }}
    </div>
</div>
    </div></div>
{% endblock %}
", "registration/register.html.twig", "C:\\xampp\\htdocs\\bikelando\\templates\\registration\\register.html.twig");
